import React from 'react';

class FilterButton extends React.Component {

    render() {
        return (
            <button className="fluid big ui button" onClick={() => { console.log('clicked', this.props.text); this.props.onClick(this.props.text); }}>
                    {this.props.text}
                </button>
            );
    }
}

export default FilterButton;
